  "text" : "\uB054\uCC0D\uD55C \uC0C8\uB07C\uC0AC\uB791\uC774 \uC717\uC138\uB300\uC758 \uC624\uB9CC\uACFC \uACE0\uC9D1\uC744 \uB9CC\uB098 \uACB0\uD569\uD560 \uB54C \uC5BC\uB9C8\uB098 \uC548 \uC88B\uC740 \uACA8\uB85C\uAC00\uB97C \uB0BC \uC218 \uC788\uB098 \uC0DD\uAC01\uD558\uAC8C \uB410\uC5C8\uB2E4. \uADF8\uAC8C \uD55C\uAD6D\uC758 \uC720\uAD50\uC640 \uAC00\uBD80\uC7A5\uC801 \uAC00\uC871\uC5D0 \uB300\uD574\uC11C \uC2E4\uC9C8\uC801\uC73C\uB85C \uCC98\uC74C \uC0DD\uAC01\uD574\uBCF8 \uACC4\uAE30\uC600\uB2E4. \uADF8 \uC774\uD6C4\uB85C\uB294 \u2018\uAC00\uC871\uC801 \uBD84\uC704\uAE30\u2019\uB780 \uB9D0\uC758 \uB450\uBC88\uC9F8 \uAE00\uC790\uC5D0 \uC545\uC13C\uD2B8.",
