  "text" : "\uBAA8\uB4E0 \uC758\uC0AC\uACB0\uC815\uC5D0\uB294 \uAC70\uB798\uAC00 \uB530\uB974\uAE30 \uB9C8\uB828\uC774\uB2E4. \uB298 \uB0B4\uAC00 \uC8FC\uC7A5\uD558\uB294 \uBC14\uC9C0\uB9CC, \uC0DD\uC0B0\uC9C1 \uC77C\uC790\uB9AC\uB97C \uC9C0\uCF1C\uB0B4\uBA74\uC11C \uACE0\uAE09 \uC5D4\uC9C0\uB2C8\uC5B4\uB9C1\uACFC \uACE0\uBD80\uAC00\uAC00\uCE58\uD654\uB97C \uD6C4\uC21C\uC704\uB85C \uBBF8\uB8F0 \uAC83\uC778\uAC00, \uC544\uB2C8\uBA74 \uADF8 \uC22B\uC790\uB9CC\uD07C \uB300\uC878\uC790 \uC774\uC0C1\uC758 \uAE00\uB85C\uBC8C \uC5D4\uC9C0\uB2C8\uC5B4\uB9C1 \uC5C5\uACC4\uC758 \uD0A4\uD50C\uB808\uC774\uC5B4\uB97C \uB9CC\uB4E4\uC5B4 \uB0BC \uAC83\uC778\uAC00.",
