  "text" : "\u201C\uB3D9\uB8CC\uAC00 \uB2E4\uC2DC \uC804\uD654\uD574\uC11C \uC30D\uC695\uC744 \uD37C\uBD80\uC5C8\uC5B4\uC694. \uC0AC\uB78C\uC774 \uC5B4\uB5BB\uAC8C \uC774\uB7EC\uB0D0\uACE0. \uADF8\uC81C\uC57C \uC791\uC5C5\uC18C\uC7A5\uC774 \uC653\uC5B4\uC694. \uD2B8\uB7ED\uC744 \uB04C\uACE0. \uADF8\uB7EC\uACE0\uB294 \uC800\uB97C \uD2B8\uB7ED\uC5D0 \uC2E4\uC5C8\uC5B4\uC694. \uC774\uB807\uB2E4 \uC800\uB807\uB2E4 \uB9D0\uB3C4 \uC5C6\uC774 \uBCF4\uB9BF\uC790\uB8E8 \uC2E3\uB4EF \uD2B8\uB7ED\uC5D0 \uC2E4\uC5B4 \uBCD1\uC6D0\uC5D0 \uB358\uC838 \uB193\uB354\uB2C8 \uADF8\uB0E5 \uAC00\uBC84\uB838\uC8E0.\u201D(\uD5C8\uD658\uC8FC, 122)",
