  "text" : "\uB098\uB3C4 \uC54C \uAC83 \uAC19\uC740 \uD5E8\uB300\uC758 \uC0B0\uC7AC\uCC98\uB9AC \uD074\uB77C\uC2A4.\n\u201C\uC6A9\uC811\uD558\uB2E4 \uD5C8\uB9AC\uB97C \uB2E4\uCCE4\uC5B4\uC694. \uC881\uC740 \uACF5\uAC04\uC5D0\uC11C \uBD88\uC548\uC815\uD55C \uC790\uC138\uB85C \uC77C\uD558\uB2E4 \uD5C8\uB9AC\uB97C \uC090\uB057\uD55C \uAC70\uC8E0. \uB3D9\uB8CC\uAC00 \uAD00\uB9AC\uC790\uC5D0\uAC8C \uC804\uD654\uD574\uC11C \uB2E4\uCE5C \uC0AC\uC2E4\uC744 \uC54C\uB838\uC5B4\uC694. \uD558\uC9C0\uB9CC 30\uBD84\uC774 \uC9C0\uB098\uB3C4 \uC544\uBB34\uB7F0 \uC870\uCE58\uAC00 \uC5C6\uC5C8\uC5B4\uC694.\u201D",
