  "text" : "\uBB3C\uB860 \uADC0\uC871\uC815\uC740 \uBCF4\uD1B5\/\uD3C9\uB4F1\/\uC9C1\uC811\/\uBE44\uBC00 \uC120\uAC70\uB77C\uB294 \uD5CC\uBC95\uC801 \uC57D\uC18D\uC744 \uAE68\uC57C\uD55C\uB2E4. \uC790\uC720\uBBFC\uC8FC\uC8FC\uC758\uB294 \uB0B4 \uB9D8\uC5D0 \uC548 \uB4DC\uB294 \uC774\uB4E4\uC758 \uC815\uCE58\uC801 \uAD8C\uD55C\uC744 \uBE7C\uC557\uC744 \uC218 \uC5C6\uB2E4\uB294 \uD569\uC758\uC5D0 \uAE30\uCD08\uD574\uC11C \uB9CC\uB4E4\uC5B4\uC9C4 \uCCB4\uC81C\uC774\uAE30 \uB54C\uBB38\uC774\uB2E4. \uB51C\uB808\uB9C8\uB294 \uD68C\uD53C\uD560 \uC218\uB294 \uC788\uC9C0\uB9CC, \uACB0\uAD6D \uD480\uC5B4\uC57C \uD55C\uB2E4.",
