  "text" : "\uB18D\uBC18 \uC9C4\uBC18\uC774\uC9C0\uB9CC, \uADC0\uC871\uC815\uD558\uBA74 \uC758\uC678\uB85C \uBB38\uC81C\uAC00 \uC27D\uB2E4. \uC9C0\uC801\uC218\uC900\uC774 \uC548 \uB418\uBA74 \uD22C\uD45C\uAD8C \uBE8F\uACE0, \uB299\uC73C\uBA74 \uCE58\uB9E4\uAC80\uC0AC\uD574\uC11C \uD22C\uD45C\uAD8C \uBE8F\uACE0, \uD610\uC624\uBC1C\uC5B8 \uD69F\uC218\uC640 \uAC15\uB3C4\uB85C \uD22C\uD45C\uAD8C \uBE8F\uC73C\uBA74 \uB41C\uB2E4. \uADF8\uB7EC\uBA74 \uC870\uC9C0 \uBD80\uC2DC \uC815\uB3C4\uC758 \uC6B0\uD30C, \uBE14\uB808\uC5B4\uB098 \uC624\uBC14\uB9C8 \uC815\uB3C4\uC758 \uC9C4\uBCF4\uC138\uB825\uC774 \uACC4\uC18D \uC9D1\uAD8C\uD560 \uAC70\uC774\uB2E4.",
