  "text" : "\uC9DA\uACE0 \uB118\uC5B4\uAC08 \uAC83\uC774 \uC788\uB2E4. \uADF8\uB7FC \uD790\uB7EC\uB9AC \uAC19\uC740 \uC815\uCE58\uC778\uC774 '\uD604\uC7A5\uC18D\uC73C\uB85C'\uC758 \uAD6C\uD638\uB97C \uAC00\uC9C0\uACE0 \uC5B8\uC5B4\uB97C \uC27D\uAC8C \uBC14\uAFB8\uACE0 \uC0C1\uC2A4\uB7EC\uC6CC\uC9C4 \uCC44 \uD2B8\uB7FC\uD504, \uC0CC\uB354\uC2A4, \uCF54\uBE48\uC744 \uB530\uB77C\uD558\uBA74 \uD558\uBA74 \uB2E4\uC2DC \uB300\uC911\uC740 \uAC01\uC131\uB418\uACE0 \uC815\uCE58\uC801 \uC6B0\uD30C\uB97C \uC9C0\uC9C0\uD558\uC9C0 \uC54A\uAC8C\uB418\uB294\uAC00? \uADF8\uB807\uC9C0 \uC54A\uB2E4\uACE0 \uC5ED\uC0AC\uB294 \uC99D\uBA85\uD55C\uB2E4.",
