  "text" : "\uD610\uC624\uC758 \uB05D\uC740 \uC9C0\uB8E8\uD55C \uC124\uB4DD\uACFC \uD3EC\uAE30\uD558\uC9C0 \uC54A\uB294 \uC9C0\uAD6C\uB825\uC744 \uAC16\uACE0 \uD611\uC0C1\uD558\uBA70 \uC560\uC4F0\uB294 \uB370\uC5D0\uC11C \uCD9C\uBC1C\uD55C\uB2E4\uB294 \uAC83\uC744 \uC54C\uACE0 \uC788\uB2E4. \uC138\uC0C1\uC5D4 \uC2DC\uC2DC\uD55C \uC0AC\uB78C\uC774 \uB300\uBD80\uBD84\uC774\uACE0 \uB098\uC774\uC2A4\uD55C \uACB0\uB860\uC740 \uBA38\uB9BF\uC18D\uC5D0\uC11C\uB098 \uC874\uC7AC\uD560 \uBFD0. \uC2DC\uC2DC\uD55C \uC0AC\uB78C\uC744 \uBC30\uC81C\uD55C \uADFC\uC0AC\uD55C \uD574\uACB0\uCC45\uC774 \uD604\uC2E4\uC758 \uD610\uC624\uB97C \uC545\uD654\uC2DC\uD0A8\uB2E4.",
