  "text" : "\uD610\uC624\uAC10\uC815\uC740 \uB204\uAD6C\uB098 \uB4E4 \uC218 \uC788\uB2E4. \uADF8\uB7EC\uB098 \uD610\uC624\uB97C \uD45C\uCD9C\uD574\uC11C \uACF5\uACA9\uC131\uC73C\uB85C \uC804\uD658\uD558\uAC70\uB098 \uC0AC\uD68C\uC801 \uBC30\uC81C\uB85C \uBFDC\uB294 \uAC83\uC740 \uB2E4\uB978 \uCC28\uC6D0. \uD55C\uAD6D\uC0AC\uD68C\uB294 \uADF8\uB7F0 \uD610\uC624 \uD45C\uCD9C\uACFC \uC0AC\uD68C\uC801 \uBC30\uC81C\uC5D0 \uB300\uD574\uC11C \uC544\uBB34\uC5B8 \uBC29\uC5B4\uAE30\uC81C\uB97C \uB9CC\uB4E4\uC9C0 \uC54A\uC558\uB2E4. \uC5EC\uC131\uD610\uC624, \uC131\uC18C\uC218\uC790\uD610\uC624, \uC774\uBBFC\uC790\uD610\uC624\uAC00 \uC81C\uC5B4\uB418\uC9C0 \uC54A\uB294\uB2E4",
